import { APP_ACTIONS } from "./actions";

const defaultState = {
  formType: "",
  signInForm: {
    email: "",
    password: "",
  },
  signInForm: {
    email: "",
    password: "",
  },
};

const reducer = (state = defaultState, action) => {
  switch (action.type) {
    case APP_ACTIONS.test:
      return {
        ...state,
      };

    default:
      return state;
  }
};

export default reducer;
